import {useState} from 'react';

const Content = () => {
    const [blogs, setBlogs] = useState([
        {id:1,title:'Blog 1 ', body:'I am a blog body...', author:'versace'},
        {id:2,title:'Blog 2 ', body:'I am a blog body...', author:'eros'},
        {id:3,title:'Blog 3 ', body:'I am a blog body...', author:'killer'}
    ])

    return ( 
        <div className="content">
            <h2>Blog Content</h2>
                {blogs.map((blog) => (
                    <div className="blg-preview">
                        <h2>{blog.title}</h2>
                        <p>written by {blog.author}</p>
                    </div>

                ))}
        </div>
     );
}
 
export default Content
